// frontend/src/App.js
import React from 'react';
import PredictForm from './components/IrisPredictForm';

const App = () => {
  return (
    <div>
      <h1>Model Prediction</h1>
      <PredictForm modelType="result_model" />
      <PredictForm modelType="iris_model" />
    </div>
  );
};

export default App;
